import React, {useEffect, useState} from 'react'


const Home = () => {
    const [heros, setHeros] = useState([])

    useEffect(() => {
        fetch('https://www.superheroapi.com/api.php/3992681667526682/search/batman')
        .then(response => response.json())
        .then(data => {
            console.log(data)
            setHeros(data)
        })
    }, [])


    return(
        <>
        <h1>heros</h1>

        <h3 style={{padding:'50px'}}> {heros.name} - id: {heros.id}</h3>
        <img src={heros.image.url}/>
        </>
    )
}

export default Home
